import React, { Component } from 'react';
import Prompt from '../Posts/Prompt'

class Feed extends Component {
    state = {  }

    getPrompts(){
        var posts = this.props.posts
        if(posts){
            posts.map((item,i) => <Prompt id={item.id} title={item.title} content={item.content}/>)
        }
    }

    render() {
        return (
            <div>
                {this.getPrompts()}
            </div>
        );
    }
}

export default Feed;
